  `race` varchar(100) NOT NULL,
  `dialect` varchar(100) NOT NULL,
  `birthdate` varchar(100) NOT NULL,
  `church` varchar(100) NOT NULL,
  `deathdate` varchar(100) NOT NULL,
  `funeral_date` varchar(100) NOT NULL,
  `final_resting_place` varchar(100) NOT NULL,
  `type_of_install` varchar(100) NOT NULL,
  `niche_type` varchar(100) NOT NULL,
  `niche_location` varchar(100) NOT NULL,
  `files` varchar(255) NOT NULL,
  `first_cp_title` varchar(255) NOT NULL,
  `first_cp_name` varchar(100) NOT NULL,
  `first_cp_nric` varchar(100) NOT NULL,
  `first_cp_address` varchar(300) NOT NULL,
  `first_cp_mobile` varchar(100) NOT NULL,
  `first_cp_religion` varchar(255) NOT NULL,
  `second_cp_title` varchar(255) NOT NULL,
  `second_cp_religion` varchar(255) NOT NULL,
  `second_cp_name` varchar(100) NOT NULL,
  `second_cp_nric` varchar(100) NOT NULL,
  `second_cp_address` varchar(300) NOT NULL,
  `second_cp_mobile` varchar(100) NOT NULL,
  `item_selection` text NOT NULL,
  `slab_returned` varchar(100) NOT NULL,
  `slab_returned_checked_by` varchar(100) NOT NULL,
  `porcelain_photo_returned_date` varchar(100) NOT NULL,
  `porcelain_photo_returned_date_checked_by` varchar(100) NOT NULL,
